"original": |2-
     Section 4.1.6.4).  This error is returned independent of the
     Client-supplied "ipp-attribute-fidelity" attribute.  The Printer MUST
     return this status-code, even if there are Job Template attributes
     that are not supported as well, since this error is a bigger problem
     than with Job Template attributes.  See Sections 4.1.6.1 and 4.1.7.
"fixed": |-
  Section 4.1.6.4).  This error is returned independent of the Client-supplied "ipp-attribute-fidelity" attribute.  The Printer MUST return this status-code, even if there are Job Template attributes that are not supported as well, since this error is a bigger problem than with Job Template attributes.  See Sections 4.1.6.1 and 4.1.7.
"ko": |-
  섹션 4.1.6.4). 이 오류는 클라이언트 제공 "ipp-attribute-fidelity" 속성과 관계없이 반환됩니다. 지원되지 않는 작업 템플릿 속성이 있더라도 프린터는 이 상태 코드를 반환해야 합니다. 이 오류는 작업 템플릿 속성보다 더 큰 문제이기 때문입니다. 섹션 4.1.6.1 및 4.1.7을 참조하십시오.
